    useEffect(useNavigate());

    return (<form>
        <nav className="nav">
        <button onClick={/*() => navigate("/")*/setNavigate("/")}>My app</button>
        <h1>
            <input></input>
            <button onClick={/*()=> navigate("/search")*/setNavigate("/search")}>search</button>
            </h1>
        <ul className="ul">
            <li>
                <button onClick={/*()=> navigate("/login")*/setNavigate("/login")}>login</button>
            </li>
            <li>
                <button onClick={/*()=> navigate("/regester")*/setNavigate("/regester")}>regester</button>
            </li>
        </ul>
    </nav>
    </form>);
};

export default Navbar
